import { Directive, EventEmitter, Output } from '@angular/core';
import { UkhoSortHeader } from './sort-header.directive';

export type SortDirection = 'asc' | 'desc' | '';

export interface SortState {
  column: string;
  direction: SortDirection;
}

@Directive({
  selector: '[ukho-sort]',
})
export class UkhoSort {
  @Output() readonly sortChange = new EventEmitter<SortState>();

  private headers = new Map<string, UkhoSortHeader>();

  public register(sortHeader: UkhoSortHeader) {
    this.headers.set(sortHeader.columnDef.name, sortHeader);
  }

  public deregister(sortHeader: UkhoSortHeader) {
    this.headers.delete(sortHeader.columnDef.name);
  }

  public onSort(state: { column: string; direction: 'asc' | 'desc' | '' }) {
    this.headers.forEach(header => (header.columnDef.name !== state.column ? header.reset() : ''));
    this.sortChange.emit(state);
  }
}

import { Directive, HostBinding, HostListener, OnDestroy, OnInit, Optional } from '@angular/core';
import { SortDirection, UkhoSort } from './sort.directive';
import { UkhoColumnDef } from './cell.directive';

@Directive({
  selector: '[ukho-sort-header]',
})
export class UkhoSortHeader implements OnInit, OnDestroy {
  constructor(@Optional() public sortDir: UkhoSort, @Optional() public columnDef: UkhoColumnDef) {}

  private readonly directions: SortDirection[] = ['asc', 'desc', ''];
  private direction: SortDirection = '';

  @HostBinding('style.cursor') styleCursor = 'pointer';
  @HostBinding('class.asc') get classAsc() {
    return this.direction === 'asc';
  }
  @HostBinding('class.desc') get classDesc() {
    return this.direction === 'desc';
  }

  @HostListener('click') click() {
    const nextDirection = this.directions[this.directions.indexOf(this.direction) + 1];
    this.direction = nextDirection || nextDirection === '' ? nextDirection : this.directions[0];
    this.sortDir.onSort({ column: this.columnDef.name, direction: this.direction });
  }

  ngOnDestroy(): void {
    this.sortDir.deregister(this);
  }

  ngOnInit(): void {
    this.sortDir.register(this);
  }

  reset() {
    this.direction = '';
  }
}

