@use '~@ukho/styles/tables';
@use '~@ukho/styles/fontawesome';

th[ukho-sort-header] {
  white-space: nowrap;

  &::after {
    @extend .fa;
    @extend .fa-caret-up, :before;
    opacity: 0;
    margin-left: 0.4rem;
  }

  &:hover::after {
    opacity: 0.4;
  }

  &.asc::after {
    opacity: 1;
  }

  &.desc::after {
    @extend .fa-caret-down, :before;
    opacity: 1;
  }
}

